  const facu = () => {};

  return (
    <>
      <input
        type="text"
        onChange={(e) => setDados}
        placeholder="qual faculdade deseja adiconar ao objeto"
      />
      <button
        onClick={(e) => {
          setDados({ ...dados, faculdade: e.target.value });
          console.log(dados);
        }}
      >
        ADD
      </button>
      <button onClick={() => setAtivo(!ativo)}>
        {ativo ? 'Ativo' : 'Inativo'}
      </button>
      <p>{dados.faculdade}</p>
    </>
  );
};

export default App;
